import React, { Component } from 'react';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';
import  Home  from "./components/layout/Home";
import  Contact  from "./components/layout/Contact";
import  Course  from "./components/layout/Course";
import  Project  from "./components/layout/Project";
import  About  from "./components/layout/About";
import  Blog  from "./components/layout/Blog";
import  Skills  from "./components/layout/Skills";
import './assets/css/style.css';
import "./assets/css/bootstrap.css";

class App extends Component {
  render() {
    return (
      <div >
          <Router>
            <Header/>
              <Switch>
                  <Route exact component={Home} path="/"/>
                  <Route component={Project} path="/project"/>
                  <Route component={Course} path="/courses"/>
                  <Route component={About} path="/about"/>

                  <Route component={Contact} path="/contact"/>
                  <Route component={Blog} path="/blog"/>

                  <Route component={Skills} path="/skills"/>
                  <Route component={About} path="css"/>
                  <Route component={About} path="/javascript"/>
                  <Route component={About} path="/reactjs"/>
                  <Route component={About} path="/mern"/>

                  <Route component={About} path="/htmlstartup"/>
                  <Route component={About} path="/myfirstapp"/>
                  <Route component={About} path="/patatap"/>
                  <Route component={About} path="/projectplanner"/>
                  <Route component={About} path="/altras"/>
              </Switch>
            <Footer/>
          </Router> 
      </div>
    );
  }
}

export default App;
